import React from 'react';
import { BrowserRouter as Router, Routes, Route, useLocation } from 'react-router-dom';
import './App.css';
import Navbar from './components/Navbar';
import LoginNavbar from './components/LoginNavbar';
import Home from './components/pages/Home';
import AboutUs from './components/pages/AboutUs';
import FindBlood from './components/pages/FindBlood';
import Login from './components/pages/Login';
import Dashboard from './components/pages/Dashboard';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<NavWrapper><Home /></NavWrapper>} />
        <Route path="/aboutus" element={<NavWrapper><AboutUs /></NavWrapper>} />
        <Route path="/findblood" element={<NavWrapper><FindBlood /></NavWrapper>} />
        <Route path="/login" element={<LoginNavbarWrapper><Login /></LoginNavbarWrapper>} />
        <Route path="/dashboard" element={<DashboardWrapper><Dashboard /></DashboardWrapper>} />
      </Routes>
    </Router>
  );
}

function NavWrapper({ children }) {
  return (
    <>
      <Navbar />
      {children}
    </>
  );
}

function LoginNavbarWrapper({ children }) {
  return (
    <>
      <LoginNavbar />
      {children}
    </>
  );
}

function DashboardWrapper({ children }) {
  return (
    <>
      <Dashboard />
      {children}
    </>
  );
}

export default App;
